r($,"bzM","bdB",()=>"Please find attached our Total Preventative Maintenance (TPM) documents. These contain our guidelines and instructions to help ensure that your CMM continues to operate with optimal efficiency and precision.\n\nWe strongly recommend reviewing this documentation and following the outlined procedures regularly. This proactive approach is key in preventing unplanned downtime, reducing maintenance costs, and extending the lifespan of your CMM.\n\nIf you have any questions or require further clarification on any part of the documentation, please don't hesitate to reach out. Our team is here to support you, and we are more than happy to walk you through the process or address any concerns you may have.\n\nThank you for choosing Hexagon MI as your trusted partner. We greatly value your business and are committed to ensuring that you receive the highest level of service and support. Please let us know how we can continue to assist you further.\n\nBest Regards\n"+A.VH()[0]+"\n")
