s($,"bxl","aW6",()=>A.a([A.zM("Using a highly versatile and accurate 6-way touch-trigger probe with a motorized indexing probe head to flexibly position the probe during measurement, the GLOBAL Touch+ model is configured to provide outstanding tactile single\u2011point measurement performance on prismatic parts.\n\nOptimal feature accessibility and minimized stylus changes are guaranteed even for the most intricate 3D part geometries.\n\nIn addition, a multi-port module changer rack allows fast and repeatable changing of probe modules with different trigger forces and styli configurations without recalibration, further contributing to streamlining measuring cycles.","Shorten tactile measurement cycles.","images/eclipse/newCmmBranding/touch.png","Global Touch+","General-purpose measurements of size features with highly repeatable touch-trigger probing."),A.zM("GLOBAL Scan+ adds tactile scanning to the range of possible applications. With tactile scanning, a large number of surface points are capturedwithin a short time, enabling highly accurate form and profile measurements on functional parts. GLOBAL Scan+ combines tactile scanning capability with the flexibility of an automatic probe head.\n\nThe scanning probe can be positioned at various spatial angles, making accessing more complex workpieces easy.\n\nAn accompanying styli changer rack accelerates the inspection process by enabling fast changes of styli configurations within a measuring program without restricting the available measurement volume","Advanced tactile scanning for comprehensive GD&T analysis.","images/eclipse/newCmmBranding/scan.jpg","Global Scan+","General-purpose measurements of size and form features with high performance tactile scanning."),A.zM("Equipped with a chromatic white light sensor as standard, GLOBAL Optics is ideal for non-contact measurement of the geometric size and form characteristics of sensitive workpieces that cannot be touched and those with particularly challenging surfaces.\n\nAn indexing probe head provides excellent access to part features from almost any angle and direction, allowing optimal alignment of the chromatic white light sensor to the measured surface.\n\nFurthermore, in combination with an automatic sensor changer rack, and thanks to Hexagon\u2019s opto-mechanical sensor interface, different sensors can be easily exchanged on the indexing probe head, maximizing the CMM\u2019s multi-sensor flexibility.","Measure micro geometries on sensitive surfaces.","images/eclipse/newCmmBranding/optics.jpg","Global Optical","Optical high-resolution measurements of miniature size and form features on challenging surfaces."),A.zM("GLOBAL Speed is equipped with Hexagon\u2019s cutting-edge laser scanning sensor as standard, combining unmatched speed, accuracy and flexibility to streamline the complete non-contact point cloud capture of freeform surfaces.\n\nFor applications ranging from complex-shaped housings to turbine blades, measuring entire part surfaces in point clouds without compromising throughput becomes a straightforward task thanks to the laser scanner\u2019s ability to capture up to 600 000 points per second. Highly accurate data is then available for comparison with nominal CAD data or reverse engineering.\n\nAn indexing probe head ensures the sensor is always optimally aligned with the workpiece surface being measured, while an automatic sensor changer rack allows the fully-automatic exchange of the laser scanner with other tactile or optical sensors during the measurement routine.","3D laser scanning with millions of highly accurate data points.","images/eclipse/newCmmBranding/speed.jpg","Global Speed","High-throughput measurements of complete part surfaces with high measuring point density."),A.zM("Leitz Reference Precision combines high accuracy and precision with outstanding high-speed scanning capabilities.\n\nThe model\u2019s fixed scanning head ensures high, repeatable accuracy even with extra-long probe extensions and heavy styli clusters. This enables users to use high-accuracy scanning across a broader range of measurement applications, including inspecting features deep within parts.\n\nIn addition, a modular sensor and styli changer rack enables the selection of the best styli options for each application","Measure tight tolerance size and form features.","images/eclipse/newCmmBranding/precision.jpg","Leitz Reference Precision","High-precision fixed probe head measurements of tight tolerance parts."),A.zM("Leitz Reference Flexibility builds upon the capabilities of the Precision configuration to boost the machine\u2019s adaptability to more challenging measurement tasks and decrease cycle time.\n\nThe CMM has an articulating probe head that measures at any angle to add accessibility to complex 3D part geometries.\n\nIn addition, the SENMATION sensor automation system increases measurement flexibility by seamlessly integrating a variety of tactile and optical sensors within one measurement routine to address multi-part or multi-feature applications.","Smart sensor automation to boost the efficiency of your measurement cycles.","images/eclipse/newCmmBranding/flexibility.jpg","Leitz Reference Flexibility","High-precision measurements of tight tolerance parts with maximum application adaptability."),A.zM("Investment in metrology can be a necessity for small-to-medium-sized enterprises that need to meet increasing customer demand.\n\nGLOBAL Lite is the ideal foundation for building up automated metrology capabilities. The CMM offers the best price/performance ratio to meet initial budget and throughput requirements.\n\nWith its simple configuration and user interface, GLOBAL Lite\u2019s ease-of-use is perfect for quality professionals with less experience of using automated CMMs.","A cost-effective and adaptable entry-point into automated dimensional inspection.","images/eclipse/newCmmBranding/globalLite.png","Global Lite","Affordable, general-purpose CMM for entry into automated measurement.")],A.ab("u<YT>")))
